import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and type 'iPhone'
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click search button using class selector
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn:visible');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_clicked.png'));

    // Wait for search results to load
    await page.waitForSelector('.search-results', { timeout: 5000 });
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_results_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_results_loaded.png'));

    // Extract search results data
    const extractedData = await page.evaluate(() => {
      const products = [];
      const productElements = document.querySelectorAll('.product-card');

      productElements.forEach((product, index) => {
        if (index < 5) { // Limit to first 5 products
          const title = product.querySelector('.product-title')?.textContent || 'No title';
          const price = product.querySelector('.product-price')?.textContent || 'No price';
          const rating = product.querySelector('.product-rating')?.textContent || 'No rating';

          products.push({
            title: title.trim(),
            price: price.trim(),
            rating: rating.trim()
          });
        }
      });

      return {
        searchTerm: 'iPhone',
        productCount: productElements.length,
        products: products
      };
    });

    return {
      success: true,
      action: "Searched for 'iPhone' products and extracted search results",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for 'iPhone' products",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
